class Paritcle {
    constructor(effect, x, y, color) {
        this.effect = effect;
        this.x = x;
        this.y = y;
        this.originX = Math.floor(x);
        this.originY = Math.floor(y);
        this.color = color;
        this.size = this.effect.gap;
        this.vx = 0;
        this.vy = 0;
        this.ease = 0.2;
        this.dx = 0;
        this.dy = 0;
        this.force = 0;
        this.angle = 0;
        this.friction = 0.95;
    }

    draw(context) {
        context.fillStyle=this.color;
        
        context.fillRect( Math.floor(this.x), Math.floor(this.y), Math.floor(this.size), Math.floor(this.size));
    }

    update() {
        this.dx = this.effect.mouse.x - this.x;
        this.dy = this.effect.mouse.y - this.y;
        this.distance = (this.dx*this.dx + this.dy * this.dy);
        this.force = -this.effect.mouse.radius / this.distance;

        if(this.distance < this.effect.mouse.radius) {
            this.angle = Math.atan2(this.dy, this.dx);
            this.vx += this.force * Math.cos(this.angle);
            this.vy += this.force * Math.sin(this.angle);
        }

        this.x += (this.vx *= this.friction) + (this.originX - this.x) * this.ease;
        this.y += (this.vy *= this.friction) + (this.originY - this.y) * this.ease;
    }

    warp() {
        this.x = Math.random() * this.effect.width;
        this.y = Math.random() * this.effect.height;
    }
}



class Effect {
    constructor(width, height) {
        this.width = width;
        this.height = height;
        this.pariclesArray = [];
        this.image = document.getElementById('image1');
        this.centerX = this.width * 0.5;
        this.centerY  = this.height * 0.5;
        this.x = this.centerX - this.image.width * 0.5;
        this.y = this.centerY - this.image.height * 0.5;
        this.gap = 5;
        this.mouse = {
            radius: 3000,
            x: undefined,
            y: undefined
        }
        window.addEventListener('mousemove', event => {
            this.mouse.x = event.x;
            this.mouse.y = event.y;
        });


    }

    init(context) {
        context.drawImage(this.image, this.x, this.y);
        const pixels = context.getImageData(0, 0, this.width, this.height).data;
        for ( let y = 0; y < this.height; y += this.gap ) {
            for ( let x = 0; x < this.width; x += this.gap) {
                const index = ( y*this.width + x) * 4;
                const red = pixels[index];
                const green = pixels[index+1];
                const blue = pixels[index+2];
                const alpha = pixels[index+3];
                const color = `rgb(${red}, ${green}, ${blue})`;

                if (alpha > 0) {
                    this.pariclesArray.push(new Paritcle(this, x, y, color));
                }

            }
        }

    }

    draw(context) {
        this.pariclesArray.forEach((particle) => { particle.draw(context); });
        
    }

    update() {
        this.pariclesArray.forEach((particle) => {
            particle.update();
        });
    }

    warp() {
        this.pariclesArray.forEach( particle => particle.warp() );
    }
}



let e = new Effect(canvas.width, canvas.height);
e.init(ctx);

function animate() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    e.draw(ctx);
    e.update();
    requestAnimationFrame(animate);
}

animate();

document.getElementById('warpButton').addEventListener('click', () => {
    e.warp();
});

document.getElementById('previous').addEventListener('click', () => {
    document.getElementById('image1').setAttribute('src', images[ getPrevious() ]);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    e = new Effect(canvas.width, canvas.height);
    e.init(ctx);
    animate();
});

document.getElementById('next').addEventListener('click', () => {
    document.getElementById('image1').setAttribute('src', images[ getNext() ]);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    e = new Effect(canvas.width, canvas.height);
    e.init(ctx);
    animate();
});


document.getElementById('custom').onclick = () => {
    var input = document.createElement('input');
    input.setAttribute('type', 'file');
    input.onchange = () => {
        const file = input.files[0];
        console.log(file);
        if(file.type == "image/png" || file.type == "image/jpeg" || file.type == "image/jpg") {
            var fileReader = new FileReader();
            fileReader.readAsDataURL(file);
            fileReader.onload = () => {
                images.push(fileReader.result);
                const imgElement = document.getElementById('image1');
                imgElement.setAttribute('src', images[images.length-1]);
                ctx.clearRect(0, 0, canvas.width, canvas.height);
                e = new Effect(canvas.width, canvas.height);
                e.gap = Math.floor( (imgElement.height + imgElement.width) / 300 );
                console.log(e.gap);
                e.init(ctx);
                animate();
            }
        }
    }
    input.click();
};